import React from 'react'
import { Link } from "react-router-dom";
import './Home.css';

function Home() {
    return (
        <div>
            <h1>This is the home page</h1>
            <Link to="quiz">Click to view our quiz page</Link>
            <Link to="aiquiz">Click to view our aiquiz page</Link>
        </div>
    );
  }

export default Home;
